import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import { deepOrange, deepPurple } from '@material-ui/core/colors';

const useStyles = makeStyles({
    avatar: {
        margin: 10,
        height: 90,
    },
    orangeAvatar: {
        margin: 10,
        color: '#fff',
        backgroundColor: deepOrange[500],
    },
    purpleAvatar: {
        margin: 10,
        color: '#fff',
        backgroundColor: deepPurple[500],
    },
});


class Profile extends React.Component {
    constructor() {
        super();
        this.state = {
            loggedIn: true
        }
    }

    loggedIn() {
        if (this.state.loggedIn !== true) {
            return <div className="profile-login-avatar">Sign In/Log In</div>
        } else {
            return <div className="profile-avatar"><Avatar className={useStyles.avatar}>H</Avatar></div>
        }
    }

    render() {
        return (
            <div className="profile">
                <div className="profile-top-page">{this.loggedIn()}</div>
                <div className="settings-bar"><span className="settings-title">Display</span></div>
                <div className="settings-bar"><span className="settings-title">Privacy</span></div>
                <div className="settings-bar"><span className="settings-title">Notifications</span></div>
            </div>
        )
    }
}

//Sign in/login
//Avatar
//Username
//settings -- dark mode
//Notification
// 

export default Profile;
